import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from '../serviceWorker';
import withConnect from '../components/withConnect';
import Translation from '../components/translation';
import { methods, samplePayload } from '../components/translation/payload';
import { AnnotationType } from '../types';

const TranslationComp: React.FC = withConnect({ type: AnnotationType.TRANSLATION, methods, samplePayload })(Translation);

ReactDOM.render(
  <TranslationComp />,
  document.getElementById('root'),
);

serviceWorker.unregister();
